syntax = "proto3";
package conductor.proto;

import "google/protobuf/struct.proto";

option java_package = "com.netflix.conductor.proto";
option java_outer_classname = "JumpWorkflowExecutionRequestPb";
option go_package = "github.com/netflix/conductor/client/gogrpc/conductor/model";

message JumpWorkflowExecutionRequest {
    map<string, google.protobuf.Value> skipped_tasks_output = 3;
    map<string, google.protobuf.Value> jump_task_input = 2;
    string task_reference_name = 1;
}
